// 龙门镖局大弟子张飞，今得江湖重托，以快刀术斩群雄，助正道除魔卫道
// 门派角色：龙门镖局 - 飞鹰侠 
// 武功招式：快刀六式 - 初式一刀两断，分清敌我；
//          中式五方乱舞，搅乱贼心；
//          终式雷霆万钧，力拔山兮气盖世
function quickSort(arr) {
  // 若弟子面前之阵无一敌手，即此阵已破，则径直杀出！
  if (arr.length <= 1) return arr;

  // 按照掌门之令，选取一刀为分界，左方弟子皆在刀下，右则反之
  const pivot = arr[0];
  const left = [];
  const right = [];

  for (let i = 1; i < arr.length; i++) {
    // 非我族类，其心必异。以刀验之。
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }

  // 将两支弟子按兵分三路，齐头并进！左方先斩后杀，右则反之；中央为帅，雷霆万钧。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
